HUD={
	score=0,
	level=1
}

blobby={
	x=230,
	y=103,
	speed=1,
	vx=0,
	vy=0,
	costume=256,
	lives=3
}

slime={
	x=0,
	y=0,
	active=false,
	vx=0
}

fruits={}
enemies={}

gravity=0.2
init=true

function addEnemy(costume,x,y)
	local enemy={
		spawnX=x,
		spawnY=y,
		x=x,
		y=y,
		costume=costume,
		active=true
	}

	table.insert(enemies,enemy)
end

function drawEnemies()
	for _,e in ipairs(enemies) do
		if e.active then
			spr(e.costume,e.x,e.y,0)
		else
			spr(e.costume+5,e.x,e.y,0)
		end
	end
end

function hud()
	rect(0,0,240,8,0)
	local w=print("HANGRY BLOBBY!",1,1,5)
	local w1=print("LEVEL "..HUD.level,w+5,1,4)
	print("SCORE "..HUD.score,w+w1+10,1,6)

	for num=1,blobby.lives do
		spr(288,240-(num*8),0,0)
	end
end

function collision(px,py,ox,oy)
	local hitX = false
	local hitY = false

	-- player hit horizontally
	if (px>ox and px<ox+8) or
			(px+8>ox and px+8<ox+8) then
				hitX=true
	end

	-- player hit vertically
	if (py>oy and py<oy+8) or
			(py+8>oy and py+8<oy+8) then
				hitY=true
	end

	if hitX and hitY and py<oy then
		return "top hit"
	elseif hitX and hitY then
		return "hit"
	else
		return false
	end
end

function collectFruit()
	for _,f in ipairs(fruits) do
		local hit=collision(blobby.x,blobby.y,f.x,f.y)
		
		if hit and f.active then
			f.active=false
			HUD.score = HUD.score+1
		end
	end
end

function setFruits(count)
	for c=1,count do
		local loc=randomLocation()
		local myX=loc[1]
		local myY=loc[2]

		fruit={
			x=myX,
			y=myY,
			active=true,
			costume=math.random(304,306)
		}

		table.insert(fruits,fruit)
	end
end

function tileAt(x,y)
	-- is tile at x,y a solid tile?
	return mget(x//8,y//8) < 64
end

function moveBlobby()
	-- check horizontal movement
	if btn(2) then -- left
		blobby.vx=-1*blobby.speed
		blobby.costume=262
	elseif btn(3) then -- right
		blobby.vx=blobby.speed
		blobby.costume=259
	else
		blobby.vx=0
		blobby.costume=256
	end

	-- check for horizontal corner collisions
	u=blobby.y+blobby.vy
	d=blobby.y+blobby.vy+7
	l=blobby.x+blobby.vx
	r=blobby.x+blobby.vx+7

	if blobby.vx<0 and (tileAt(l,u) or tileAt(l,d)) then
		blobby.vx=0
	elseif blobby.vx>0 and (tileAt(r,u) or tileAt(r,d)) then
		blobby.vx=0
	end

	-- check for bottom collisions
	if tileAt(l,d+1) or tileAt(r,d+1) then
		blobby.vy=0
	else
		blobby.vy=blobby.vy+gravity
	end

	-- check for jumping
	if btnp(0) then
		blobby.vy=-3
		blobby.costume=256
	end

	-- check for top collisions
	if blobby.vy<0 and (tileAt(l,u) or tileAt(r,u)) then
		blobby.vy=0
	end

	-- update position
	blobby.x = blobby.x+blobby.vx
	blobby.y = blobby.y+blobby.vy
end

function checkLimits()
	if blobby.y<9 then blobby.y=9 end
	if blobby.x<1 then blobby.x=231 end
	if blobby.x>231 then blobby.x=0 end	
end

function throwSlime()
	if slime.active then
		slime.x=slime.x+slime.vx*1.5

		if slime.x<0 or slime.x>232 then
			slime.active=false
		else
			spr(320+t%30//20,slime.x,slime.y,0)
		end
	elseif btnp(4) and blobby.vx ~= 0 then
		slime.active=true
		slime.vx=blobby.vx

		if blobby.vx>0 then
			slime.x = blobby.x+9
		else
			slime.x = blobby.x-9
		end

		slime.y=blobby.y
	end
end

function initialize()
	setFruits(5)
	addEnemy(352,20,103)
	addEnemy(352,32,16)
end

function drawFruits()
	for _,fruit in ipairs(fruits) do
		if fruit.active then
			spr(fruit.costume,fruit.x,fruit.y,0)
		end
	end
end

function TIC()
	if init then
		initialize()
		init=false
	end

	cls()
	
	t=time()//10

	map(0,0,30,17)
	hud()
	drawFruits()

	moveBlobby()
	checkLimits()

	drawEnemies()
	collectFruit()
	throwSlime()
	hitEnemy()
	
	spr(blobby.costume+t%60//30,blobby.x,blobby.y,0)
end

function randomLocation()
	solidHere = true
	blobbyHereX = true
	blobbyHereY = true

	while solidHere or (blobbyHereX and blobbyHereY) do
		newX=math.random(4,228)
		newY=math.random(12,124)

		blobbyHereX=blobby.x==newX
		blobbyHereY=blobby.y==newY
		solidHere=tileAt(newX,newY) or
							tileAt(newX+8,newY) or
							tileAt(newX,newY+8) or
							tileAt(newX-8,newY+8)
	end

	return {newX, newY}
end

function hitEnemy()
	for _,e in ipairs(enemies) do
		local hit=collision(blobby.x,blobby.y,e.x,e.y)
		
		if hit =="top hit" and e.active then
			e.active=false		
		elseif hit=="hit" and e.active then
			blobby.lives=blobby.lives-1
			blobby.x=230
			blobby.y=103
		end 
	end
end

